import React from 'react';
import logo from '../Images/Logo.jpg';

function Footer() {
    return (
        <footer className="footer">
            <div className="container">
                
            </div>
            <div className="row">
                <div className="col">
                    <img src={logo} className="footer-logo" alt="Image" />
                    <p>vaydgawu</p>
                </div>
            </div>
        </footer>
    )
}

export default Footer;
